INSERT INTO `news` VALUES (127,'JPHP — Как он работает. История создания','2014-04-07 20:21:08','В этой статье я расскажу более подробно об истории проекта JPHP и каким образом он был разработан с технической стороны. Текст будет интересен как простым разработчикам PHP, так и любителям компиляторов. Я постарался описать все на простом языке.\r\nJPHP это компилятор языка PHP для Java VM. Две недели назад я писал статью о проекте. Похожие проекты — JRuby для ruby, Jython для python. После публикации первой статьи о JPHP, проект за два дня набрал 500 звёзд на гитхабе и успел засветиться не только в РУнете, но и на зарубежных ресурсах, успел побывать на первом месте в рейтинге гитхаба.',1,3,'a11bf303982a965ffcd6b2d6ff9cdf20.png','PNG\r\n\Z\n\0\0\0\rIHDR\0\0\0\0F\0\0\0F\0\0\0gAMA\0\0a\0\0\0sRGB\0\0\0\0 cHRM\0\0z&\0\0\0\0\0\0\0\0\0u0\0\0`\0\0:\0\0pQ<\0\0\0bKGD\0\0\0\0\0\0	pHYs\0\0\0\0~\0\0\0IDATxuxWߕnM 	@Hn!@Kq)VHS[[h8www@ēլ|lvMKyܹ3{=\\d2aǎ;JP(dȑL8,}	ޘ6Hbz67D&e9Nr5f&LRe/wqaO}Xt1ǀ)sYivر*5z4[oܾy[QF-TJ[\0\rmH`EoiykmP$@& vtD\"	6I{iemHm~g_uW]/}_N/jH2YHkjbb3kGfˋ2-vcN&O  H+_.`2p*徨d+ϙ~ߋ~9ކr^@^v>zz\Z%Ә0\ZL6H)gҶ7=w}zy!RH$`܃<޽^ƴ,}^u7:;vXĺzfÔz]b!\'ƣO7iWV\0#)!Pz/zi]رmyQLp $\0?#,-\Z\Z7Ood2G)\Z}|ȈGܹzDf\n>hTJ\ZuV7.v]P&Df:T*EhsR\'gn߁hM၃ׯ<)@۱c3GN|r >>ީKcG(w\0{rqlLFd2\n.\n@\"o4pqUOJJ4@۱c\'[P%KZNN/jVV st .)T	zr^>Hz(}vcG@ PYwoސMV9h;/kRFHb2xJmǎlˬg˾J+Z#o_<Fc\"_ RO	aC`\0\\qWфX‛9Y>oرQR@rzyp>Djwsy1z!ENa\"*WfZ;v[}ӓ%KHY.nV7#[\'XɳHTJ%B2h2\0P%gW.v6D\"\0n;j7mvRɉ)buh)kmǎ+Ro;fF+Ӭh0I`tZn߻m#&;3у2m\"+.v*U60*2o!`CblLV7#[\"	9dVSPA>X^T.v谸]i[oO+/|\0G38:9ȝ\'in8J\"%%GGG$KMJJh4b3YIHH\0`0p!߿Of`m1L$&&H$nOLLD&\n_-M̰/G5\Z$%%!\nqqqnt_ Lμu zmqjZRŝɈD&&9|\ZhDVc2xz&A|hˊWE[jB`ٯ<600Bc\rGGG3l0/D\"APP(ȑ#M46\"c$\'\'3gNLbv=\n+W}vi}2O,Āu9\Zqw<رc(\nmO<vuuE*RT)&Md]S\"n@\Z=&*bbC\0M|Bx ,.ǹsSϞ=@&!\nI^~TТEF\ZEtt4̙&Mdu>(\"(SkUp-Nʺu8q